INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "あたしだって\nやるときはやるよ！", 24001, 24, 1, 0, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24002, 24, 1, 1, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", 24003, 24, 1, 2, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "やったね！\nこれでようやく\nサボれるよ…", 24004, 24, 2, 3, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24005, 24, 1, 4, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24006, 24, 2, 5, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "あたしも意外と\nやるもんでしょ？", 24007, 24, 2, 6, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24008, 24, 4, 7, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24009, 24, 4, 8, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "まじめに\nやったんだけどな…\n悔しいな～", 24010, 24, 4, 9, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "やられた…\nねずみって意外と\nてごわいね", 24011, 24, 4, 10, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24012, 24, 4, 11, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (0.0, 10040, "リン", 1.81, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", 24013, 24, 4, 12, 1);
